import './Library.scss';
import { Link } from "react-router-dom";

export const Library = () => {
  return (
    <>
      <ul className="library">
        <li key="liturgia" className="library__element">
          <Link  to="liturgia" className="itemLink">
            Liturgia
          </Link>
        </li>
      </ul>
    </>
  )
}
